import {useState} from "react";
function App() {

  const [toDo, setToDo] = useState("");
  const onChange=(event)=>setToDo(event.target.value);
  console.log(toDo)
  return (
    <div>
      <form>
        <input onChange={onChange} value={toDo} type="text" placeholder="Write your to do..."/>
      </form>
      <button>Add To Do</button>
    </div>
  )
}

export default App;
